import { StyleSheet, View } from 'react-native';

import Registro from './src/screens/Registro';

function App() {
  return (
    <View style={styles.container}>
      <Registro/>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});

export default App;
